# ---- Safe Excel writer helper (no openpyxl dependency) ----
def _safe_excel_bytes(df_dict):
    '''Return bytes for an .xlsx using xlsxwriter, or a .zip of CSVs if xlsxwriter is unavailable.'''
    import io, zipfile
    try:
        import xlsxwriter  # noqa: F401
        buf = io.BytesIO()
        with pd.ExcelWriter(buf, engine="xlsxwriter") as writer:
            for sheet_name, df in df_dict.items():
                df.to_excel(writer, index=False, sheet_name=(sheet_name[:31] or "Sheet1"))
        buf.seek(0)
        return buf.getvalue(), "xlsx"
    except Exception:
        buf = io.BytesIO()
        with zipfile.ZipFile(buf, mode="w", compression=zipfile.ZIP_DEFLATED) as zf:
            for sheet_name, df in df_dict.items():
                csv_bytes = df.to_csv(index=False).encode("utf-8")
                zf.writestr(f"{sheet_name}.csv", csv_bytes)
        buf.seek(0)
        return buf.getvalue(), "zip"


