def _is_admin():
    """Return True if current user should see admin-only controls."""
    roles = st.session_state.get("roles") or []
    if isinstance(roles, str):
        roles = [roles]
    roles = [str(r).lower() for r in roles]
    username = str(st.session_state.get("username", "")).lower()

    # Update this set to match the usernames you want to treat as admins
    admin_usernames = {"admin", "mattijs"}
    admin_roles = {"admin", "administrator"}

    if username in admin_usernames:
        return True
    if any(r in admin_roles for r in roles):
        return True
    return False


