# ---------- Core model ----------
class Airport:
    def __init__(self, initial_traffic, initial_equity, initial_assets, initial_opex_ratio, initial_asset_value, initial_cargo_tonnes):
        self.strategy = None
        self.year = 0
        self.traffic = initial_traffic
        self.cargo_tonnes = initial_cargo_tonnes
        self.capacity_pax = 15_000_000
        self.runway_capacity_movements = 38
        self.pax_per_movement = 150
        self.peak_hour_factor = 0.15
        self.current_movements = (self.traffic / self.pax_per_movement / 365) * self.peak_hour_factor

        self.equity = initial_equity
        self.assets = initial_assets
        self.debt = 0.0
        self.loans = []

        self.opex_ratio = initial_opex_ratio
        self.asset_replacement_value = initial_asset_value
        self.opex = self.asset_replacement_value * self.opex_ratio

        self.marketing_budget_left = 5_000_000.0
        self.marketing_expense = 0.0
        self.capex_projects = []
        self.capex_cash_outflow = 0.0
        self.depreciation = 0.0

        self.aeronautical_charge = 15.0
        self.cargo_charge_per_tonne = 100.0
        self.non_aero_spend_per_pax = 10.0
        self.non_aero_sqm = 5000.0
        # --- Added for new CAPEX projects ---
        self.real_estate_m2 = 0.0
        self.real_estate_rent_income = 0.0  # /year, recurring rent from real estate
        self.real_estate_rent_per_m2_default = 350.0  # /m/year assumption
        self.cargo_tonnes_per_m2_hangar = 2.0  # tonnes per m per year when hangar opens
        # Multiplier for marketing-driven uplift in RE rent income
        self.real_estate_rent_multiplier = 1.0

        self.revenue_aero = 0.0
        self.revenue_non_aero = 0.0
        self.revenue_cargo = 0.0

        self.interest_paid = 0.0
        self.profit_before_comp = 0.0
        self.profit_after_comp = 0.0
        self.retained_earnings = 0.0
        self.compensation = 0.0

        self.gdp_growth_factor = 1.0
        self.quality_factor = 1.0
        self.marketing_impact = 0.0
        self.charge_impact = 0.0
        self.opex_quality_impact = 0.0
        self.cost_impact = 0.0
        self.traffic_growth_rate = 0.0
        self.cargo_growth_rate = 0.0

        self.EBITDA = 0.0
        self.EBITDAR = 0.0
        self.concession_revenues = 0.0
        self.ancillary_revenues = 0.0
        self.total_opex = 0.0
        self.cash_balance = 50_000_000.0
        self.cfo = 0.0
        self.cfi = 0.0
        self.cff = 0.0

        self.new_loans_this_year = 0.0

        # Low-Cost Terminal parameters
        self.low_cost_terminal_count = 0
        self.low_cost_terminal_cap_added = 0  # cumulative pax capacity added by LCT
        self.low_cost_terminal_elasticity_bonus = 0.2  # extra price elasticity when at least one LCT is operational
        self.low_cost_terminal_opex_ratio_delta = -0.005  # reduce opex ratio by 0.5 percentage points per LCT

        # Defaults for structured OPEX (not used unless switched)
        self.opex_mode = "ratio"

    def get_gearing(self):
        if self.equity == 0:
            return float('inf')
        return float(self.debt) / float(self.equity)

    def add_capex_project(self, project_name, cost, capacity_increase, lead_time, loan_amount, **kwargs):
        """Register a CAPEX project with proper cash handling and lead-time.
        All projects added carry 'added_this_year'=True so the first year does not decrement lead time.
        """
        cost = float(cost)
        loan_amount = float(loan_amount)

        # (A) Third-party cargo hangar: no cash impact, boosts cargo when operational
        if project_name == 'Cargo Hangar (3rd party)':
            cargo_m2 = float(kwargs.get('cargo_m2', 0.0))
            self.capex_projects.append({
                'name': project_name,
                'cargo_m2': cargo_m2,
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            st.info(f"Third-party project 'Cargo Hangar' initiated ({cargo_m2:,.0f} m). It will be operational in {lead_time} year(s).")
            return True

        # (B) Non-Aero Ops Investment: low investment; uplifts spend-per-pax when operational
        if project_name == 'Non-Aero Ops Investment':
            spend_uplift = float(kwargs.get('spend_uplift', 0.0))  # e.g., +0.06 => +6%
            equity_portion = cost - loan_amount
            if equity_portion > 0 and (self.cash_balance + self.new_loans_this_year + 1e-9) < equity_portion:
                st.error(f"Project '{project_name}' denied: Insufficient cash to fund equity portion ({equity_portion:,.2f}).")
                return False
            self.capex_projects.append({
                'name': project_name,
                'cost': cost,
                'spend_uplift': spend_uplift,
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            if loan_amount > 0.0:
                if not self.take_loan(loan_amount):
                    return False
            self.equity -= equity_portion
            self.capex_cash_outflow += cost
            st.info(f"Project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
            return True

        # (C) Real Estate Investment: adds m and recurring rent; impacts cash and assets
        if project_name == 'Real Estate Investment':
            re_m2 = float(kwargs.get('re_m2', 0.0))
            rent_per_m2 = float(kwargs.get('rent_per_m2', self.real_estate_rent_per_m2_default))
            equity_portion = cost - loan_amount
            if equity_portion > 0 and (self.cash_balance + self.new_loans_this_year + 1e-9) < equity_portion:
                st.error(f"Project '{project_name}' denied: Insufficient cash to fund equity portion ({equity_portion:,.2f}).")
                return False
            self.capex_projects.append({
                'name': project_name,
                'cost': cost,
                're_m2': re_m2,
                'rent_per_m2': rent_per_m2,
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            if loan_amount > 0.0:
                if not self.take_loan(loan_amount):
                    return False
            self.equity -= equity_portion
            self.capex_cash_outflow += cost
            st.info(f"Project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
            return True

        # (D) New Low Cost Terminal
        if project_name == 'New Low Cost Terminal':
            equity_portion = cost - loan_amount
            if equity_portion > 0 and (self.cash_balance + self.new_loans_this_year + 1e-9) < equity_portion:
                st.error(f"Project '{project_name}' denied: Insufficient cash to fund equity portion ({equity_portion:,.2f}).")
                return False
            self.capex_projects.append({
                'name': project_name,
                'cost': cost,
                'capacity_pax': int(capacity_increase),
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            if loan_amount > 0.0:
                if not self.take_loan(loan_amount):
                    return False
            self.equity -= equity_portion
            self.capex_cash_outflow += cost
            st.info(f"Project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
            return True

        # (Legacy) Specific older cases
        if project_name == 'Cargo Hangar':
            self.capex_projects.append({
                'name': project_name,
                'cost': cost,
                'capacity_increase': capacity_increase,
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            st.info(f"Third-party project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
            return True

        if project_name == 'Non-Aero Retail Expansion':
            equity_portion = cost - loan_amount
            if equity_portion > 0 and (self.cash_balance + self.new_loans_this_year + 1e-9) < equity_portion:
                st.error(f"Project '{project_name}' denied: Insufficient cash to fund equity portion ({equity_portion:,.2f}).")
                return False
            self.capex_projects.append({
                'name': project_name,
                'cost': cost,
                'non_aero_sqm_increase': 1000,
                'lead_time': int(lead_time),
                'added_this_year': True
            })
            self.equity -= equity_portion
            self.capex_cash_outflow += cost
            if loan_amount > 0.0:
                self.take_loan(loan_amount)
            st.info(f"Project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
            return True

        # Generic aero/other projects using capacity_pax
        equity_portion = cost - loan_amount
        if equity_portion > 0 and (self.cash_balance + self.new_loans_this_year + 1e-9) < equity_portion:
            st.error(f"Project '{project_name}' denied: Insufficient cash to fund equity portion ({equity_portion:,.2f}).")
            return False
        self.capex_projects.append({
            'name': project_name,
            'cost': cost,
            'capacity_pax': int(capacity_increase),
            'lead_time': int(lead_time),
            'added_this_year': True
        })
        if loan_amount > 0.0:
            self.take_loan(loan_amount)
        self.equity -= equity_portion
        self.capex_cash_outflow += cost
        st.info(f"Project '{project_name}' initiated. It will be operational in {lead_time} year(s).")
        return True

    def apply_marketing_impact(self, campaign_choice):
        marketing_options = {
            'a': {'cost': 1.8e6, 'impact': 0.015, 'type': 'aero'},
            'b': {'cost': 2e6, 'impact': 0.02, 'type': 'aero'},
            'c': {'cost': 5e6, 'impact': 0.04, 'type': 'aero'},
            'd': {'cost': 2.5e6, 'impact': 0.03, 'type': 'aero'},
            'e': {'cost': 1.25e6, 'impact': 0.01, 'type': 'aero'},
            'f': {'cost': 1e6, 'impact': 0.1, 'type': 'non_aero'},
            'g': {'cost': 2e6, 'impact': 0.2, 'type': 'non_aero'},
            'h': {'cost': 1.5e6, 'impact': 0.06, 'type': 'real_estate'}
        }

        cost = marketing_options[campaign_choice]['cost']
        if self.marketing_budget_left >= cost:
            self.marketing_budget_left -= cost
            self.marketing_expense = getattr(self, 'marketing_expense', 0.0) + cost

            if marketing_options[campaign_choice]['type'] == 'aero':
                self.marketing_impact += marketing_options[campaign_choice]['impact']
            elif marketing_options[campaign_choice]['type'] == 'non_aero':
                self.non_aero_spend_per_pax *= (1 + marketing_options[campaign_choice]['impact'])
            elif marketing_options[campaign_choice]['type'] == 'real_estate':
                # Uplift RE rent income via a persistent multiplier used in revenue calc
                self.real_estate_rent_multiplier *= (1 + marketing_options[campaign_choice]['impact'])

            st.success(f"Marketing campaign '{campaign_choice}' funded. Remaining budget: {self.marketing_budget_left:,.2f}")
            return True
        else:
            st.warning(f"Insufficient budget to fund campaign '{campaign_choice}'. Remaining budget: {self.marketing_budget_left:,.2f}")
            return False

    def take_loan(self, amount):
        amount = float(amount)
        if self.equity <= 0 or (self.debt + amount) / self.equity > 0.6:
            st.error("Loan denied: gearing (debt/equity) would exceed 0.6 or equity is zero.")
            return False
        self.debt += amount
        self.new_loans_this_year += amount
        self.loans.append({'amount': amount, 'original_amount': amount, 'years_remaining': 10, 'interest_rate': 0.045})
        st.success(f"Loan of {amount:,.2f} taken. Total debt is now {self.debt:,.2f}.")
        return True

    def update_for_new_year(self, gdp_growth, opex_change, aero_charge_change):
        self.gdp_growth_factor = 1 + (gdp_growth / 100)
        self.quality_factor = 1.0
        self.opex_quality_impact = 0.0
        self.cost_impact = 0.0
        self.cargo_growth_rate = 0.0

        strategy_params = {
            'Long Haul Hub': {'price_elasticity': 0.2, 'opex_quality_benchmark': 0.10, 'cost_penalty_multiplier': 1.5, 'quality_boost_multiplier': 6},
            'Regional Hub': {'price_elasticity': 0.4, 'opex_quality_benchmark': 0.0813, 'cost_penalty_multiplier': 2, 'quality_boost_multiplier': 5},
            'Short Haul Spoke': {'price_elasticity': 0.7, 'opex_quality_benchmark': 0.07, 'cost_penalty_multiplier': 3, 'quality_boost_multiplier': 4},
            'Long Haul Spoke': {'price_elasticity': 0.5, 'opex_quality_benchmark': 0.085, 'cost_penalty_multiplier': 2.5, 'quality_boost_multiplier': 5},
            'Low-Cost Airport': {'price_elasticity': 0.9, 'opex_quality_benchmark': 0.05, 'cost_penalty_multiplier': 4, 'quality_boost_multiplier': 2},
            'Cargo Airport': {'price_elasticity': 0.1, 'opex_quality_benchmark': 0.15, 'cost_penalty_multiplier': 1.0, 'quality_boost_multiplier': 8},
            'Passenger and Cargo Hub': {'price_elasticity': 0.3, 'opex_quality_benchmark': 0.12, 'cost_penalty_multiplier': 1.8, 'quality_boost_multiplier': 7}
        }
        params = strategy_params.get(self.strategy, strategy_params['Regional Hub'])

        # Completed projects
        self.depreciation = 0.0
        for project in list(self.capex_projects):
            # Do not decrement the lead time on the same year the project was added
            if project.get('added_this_year'):
                project['added_this_year'] = False
                continue
            project['lead_time'] -= 1
            if project['lead_time'] <= 0:
                # New project types go live
                if project['name'] == 'Cargo Hangar (3rd party)':
                    cargo_m2 = float(project.get('cargo_m2', 0.0))
                    bonus = cargo_m2 * self.cargo_tonnes_per_m2_hangar
                    self.cargo_tonnes += bonus
                    st.info(f"Cargo Hangar (3P) now operational: +{bonus:,.0f} tonnes/yr from {cargo_m2:,.0f} m.")
                elif project['name'] == 'Non-Aero Ops Investment':
                    uplift = float(project.get('spend_uplift', 0.0))
                    self.non_aero_spend_per_pax *= (1 + uplift)
                    st.info(f"Non-Aero Ops Investment operational: spend per pax increased by {uplift*100:.1f}%.")
                elif project['name'] == 'Real Estate Investment':
                    re_m2 = float(project.get('re_m2', 0.0))
                    rent_per_m2 = float(project.get('rent_per_m2', self.real_estate_rent_per_m2_default))
                    self.real_estate_m2 += re_m2
                    self.asset_replacement_value += project.get('cost', 0.0)
                    self.depreciation += project.get('cost', 0.0) / 30.0  # 30-year depreciation
                    self.real_estate_rent_income += re_m2 * rent_per_m2
                    st.info(f"Real Estate Investment operational: +{re_m2:,.0f} m; recurring rent {re_m2 * rent_per_m2:,.0f}/yr.")
                elif project['name'] == 'Cargo Hangar':
                    self.cargo_tonnes += project['capacity_increase']
                    st.info("Cargo Hangar is now operational, attracting more cargo traffic!")
                elif project['name'] == 'Non-Aero Retail Expansion':
                    self.non_aero_sqm += project['non_aero_sqm_increase']
                    self.asset_replacement_value += project.get('cost', 0.0)
                    self.depreciation += project.get('cost', 0.0) / 25.0
                    st.info("Non-Aero Retail Expansion is now operational, increasing retail space!")
                elif project['name'] == 'New Low Cost Terminal':
                    self.capacity_pax += project.get('capacity_pax', 0)
                    self.asset_replacement_value += project.get('cost', 0.0)
                    self.depreciation += project.get('cost', 0.0) / 25.0
                    # Apply permanent effects of LCT
                    self.low_cost_terminal_count += 1
                    self.low_cost_terminal_cap_added += project.get('capacity_pax', 0)
                    self.opex_ratio = max(0.01, self.opex_ratio + self.low_cost_terminal_opex_ratio_delta)
                    st.info("New Low Cost Terminal is now operational: capacity added with lower operating cost profile.")
                else:
                    self.capacity_pax += project.get('capacity_pax', project.get('capacity_increase', 0))
                    self.asset_replacement_value += project.get('cost', 0.0)
                    self.depreciation += project.get('cost', 0.0) / 25.0
                    st.info(f"Project '{project['name']}' is now operational!")
                self.capex_projects.remove(project)

        # Capacity effects on quality
        terminal_capacity_utilization = self.traffic / max(1, self.capacity_pax)
        if terminal_capacity_utilization > 0.8:
            self.quality_factor *= max(0.5, 1 - (terminal_capacity_utilization - 0.8) * 2)

        self.current_movements = (self.traffic / max(1, self.pax_per_movement) / 365) * self.peak_hour_factor
        runway_utilization = self.current_movements / max(1, self.runway_capacity_movements)
        if runway_utilization > 0.8:
            self.quality_factor *= max(0.5, 1 - (runway_utilization - 0.8) * 2)
        self.quality_factor = max(0.5, min(1.5, self.quality_factor))

        current_opex_ratio = self.opex / max(1.0, self.asset_replacement_value)
        if current_opex_ratio < params['opex_quality_benchmark']:
            opex_quality_penalty = 1 - (params['opex_quality_benchmark'] - current_opex_ratio) * params['quality_boost_multiplier']
            self.quality_factor *= max(0.5, opex_quality_penalty)
            self.opex_quality_impact = self.quality_factor - 1
        elif current_opex_ratio > params['opex_quality_benchmark']:
            opex_quality_boost = (current_opex_ratio - params['opex_quality_benchmark']) * params['quality_boost_multiplier']
            self.quality_factor *= 1 + opex_quality_boost
            self.opex_quality_impact = opex_quality_boost
            cost_penalty = (current_opex_ratio - params['opex_quality_benchmark']) * params['cost_penalty_multiplier']
            self.cost_impact = cost_penalty

        aero_charge_elasticity = params['price_elasticity']
        if self.low_cost_terminal_count > 0:
            aero_charge_elasticity += self.low_cost_terminal_elasticity_bonus * self.low_cost_terminal_count
        self.charge_impact = -(aero_charge_change / 100.0) * aero_charge_elasticity
        self.traffic_growth_rate = (self.gdp_growth_factor - 1) + (self.quality_factor - 1) + self.marketing_impact + self.charge_impact - self.cost_impact
        self.traffic = min(self.traffic * (1 + self.traffic_growth_rate), self.capacity_pax * 1.5)

        # Cargo growth (simplified)
        self.cargo_growth_rate = ((self.gdp_growth_factor - 1) * 0.5) + (self.marketing_impact * 0.5)
        self.cargo_tonnes *= (1 + self.cargo_growth_rate)

        # Apply airport charge change ONCE
        self.aeronautical_charge *= (1 + aero_charge_change / 100.0)

        # OPEX evolution (ratio mode by default)
        if self.opex_mode == "ratio":
            self.opex *= (1 + opex_change / 100.0)

        # Revenues & totals
        # Base non-aero spend plus recurring real-estate rent income
        self.revenue_non_aero = (
            self.traffic * self.non_aero_spend_per_pax * (self.non_aero_sqm / 5000.0)
        ) + self.real_estate_rent_income * self.real_estate_rent_multiplier
        self.revenue_aero = self.traffic * self.aeronautical_charge
        self.revenue_cargo = self.cargo_tonnes * self.cargo_charge_per_tonne
        total_revenue = self.revenue_aero + self.revenue_non_aero + self.revenue_cargo

        self.total_opex = self.opex + getattr(self, 'marketing_expense', 0.0)
        self.concession_revenues = self.revenue_non_aero * 0.8
        self.ancillary_revenues = self.revenue_non_aero * 0.2
        self.EBITDA = total_revenue - self.total_opex
        self.EBITDAR = self.EBITDA + self.ancillary_revenues

        # Debt service
        self.interest_paid = 0.0
        loan_principal_repayment = 0.0
        loans_to_keep = []
        for loan in self.loans:
            self.interest_paid += loan['amount'] * loan['interest_rate']
            principal_payment = loan['original_amount'] / 10.0
            loan['amount'] -= principal_payment
            loan_principal_repayment += principal_payment
            loan['years_remaining'] -= 1
            if loan['years_remaining'] > 0:
                loans_to_keep.append(loan)
        self.loans = loans_to_keep
        self.debt = sum(l['amount'] for l in self.loans)

        # Regulated vs unregulated (simplified)
        if self.strategy == 'Cargo Airport':
            regulated_revenue = self.revenue_cargo
        elif self.strategy == 'Passenger and Cargo Hub':
            regulated_revenue = self.revenue_aero + self.revenue_cargo
        else:
            regulated_revenue = self.revenue_aero

        total_revenue_all = max(1e-9, self.revenue_aero + self.revenue_non_aero + self.revenue_cargo)
        regulated_share = regulated_revenue / total_revenue_all

        allocated_opex = self.opex * regulated_share
        allocated_depr = self.depreciation * regulated_share
        allocated_interest = self.interest_paid * regulated_share
        allocated_equity = self.equity * regulated_share

        self.regulated_profit = regulated_revenue - allocated_opex - allocated_depr - allocated_interest
        self.unregulated_profit = (total_revenue_all - regulated_revenue) - (self.opex - allocated_opex) - (self.depreciation - allocated_depr) - (self.interest_paid - allocated_interest)

        self.compensation = 0.0
        if allocated_equity > 0:
            roe_regulated = (self.regulated_profit / allocated_equity)
            if roe_regulated > 0.10:
                excess_profit = self.regulated_profit - (allocated_equity * 0.10)
                self.compensation = max(0.0, excess_profit)
                if self.compensation > 0:
                    st.success(f"Economic Regulation Compensation paid: {self.compensation:,.2f}")

        self.profit_before_comp = self.regulated_profit + self.unregulated_profit
        self.profit_after_comp = self.profit_before_comp - self.compensation
        self.retained_earnings += self.profit_after_comp
        self.equity += self.profit_after_comp

        # Cash flow
        self.cfo = self.EBITDA - self.compensation - self.interest_paid
        self.cfi = -self.capex_cash_outflow
        self.cff = self.new_loans_this_year - loan_principal_repayment
        self.cash_balance += self.cfo + self.cfi + self.cff

        # Reset per-year accumulators
        self.marketing_expense = 0.0
        self.capex_cash_outflow = 0.0
        self.new_loans_this_year = 0.0

    def recalc_initial_baseline(self):
        cap = max(1, int(getattr(self, "capacity_pax", 1)))
        arv = float(getattr(self, "asset_replacement_value", 200_000_000.0))
        self.asset_replacement_value = (arv / max(1, cap)) * cap

        P = float(getattr(self, "traffic", 0.0))
        if P < 5_000_000:
            self.non_aero_spend_per_pax = 9.0
        elif P < 15_000_000:
            self.non_aero_spend_per_pax = 10.5
        else:
            self.non_aero_spend_per_pax = 12.0

        self.opex = max(1.0, self.asset_replacement_value) * self.opex_ratio
        self.total_opex = self.opex


