def display_historical_metrics(data):
    roe = (data['Financials']['Profit'] / data['Financials']['Equity']) * 100 if data['Financials']['Equity'] > 0 else 0
    st.subheader("Airport Performance Metrics")
    if 'Year' in data:
        st.write(f"Year: {data['Year']}")

    if data['Strategic Decisions']['Initial Strategy'] in ['Cargo Airport', 'Passenger and Cargo Hub']:
        st.write(f"Annual Cargo: {data['Operations']['Cargo Tonnes']:,.0f} tonnes")
        st.write(f"Cargo Growth: {data['Traffic Drivers']['Cargo Growth (%)']:.2f}%")

    if data['Strategic Decisions']['Initial Strategy'] != 'Cargo Airport':
        st.write(f"Annual Traffic: {data['Operations']['Traffic']:,.0f} passengers")
        st.write(f"Traffic Growth: {data['Traffic Drivers']['Traffic Growth (%)']:.2f}%")
        st.write(f"Terminal Capacity: {data['Operations']['Capacity']:,.0f} passengers")
        st.write(f"Terminal Capacity Utilization: {data['Operations']['Terminal Utilization']:.2f}%")
        st.write(f"Runway Capacity: {data['Operations']['Runway Capacity (movements/hr)']:,.0f} movements per hour")
        # Additional ops KPIs
        _sp = data['Operations'].get('Non-Aero Spend per Pax ($)', None)
        if _sp is not None:
            st.write(f"Non-Aero Spend per Pax: {_sp:,.2f}")
        st.write(f"Runway Capacity Utilization: {data['Operations']['Runway Utilization']:.2f}%")

    st.markdown("---")
    st.subheader("Financials")
    st.write(f"Total Revenue: {data['Financials']['Revenue (Total)']:,.2f}")
    st.write(f"Aero Revenue: {data['Financials']['Revenue (Aero)']:,.2f}")
    st.write(f"Non-Aero Revenue: {data['Financials']['Revenue (Non-Aero)']:,.2f}")
    st.write(f"Total OPEX (incl. Marketing): {data['Financials']['OPEX (Total incl. Marketing)']:,.2f}")
