    st.write(f"OPEX as % of Asset Replacement Value: {opex_pct_arv:.2f}%")
    st.write(f"EBITDA: {data['Financials']['EBITDA']:,.2f}")
    st.write(f"Profit after Compensation: {data['Financials']['Profit']:,.2f}")
    st.write(f"Return on Equity (ROE): {roe:.2f}%")
    st.write(f"Debt to Equity Ratio: {data['Financials']['Gearing (Debt/Equity)']:.2f}")
    st.write(f"Cash Balance (End of Year): {data['Financials']['Cash Balance (End of Year)']:,.2f}")
    st.write('---')

    st.subheader("Cash Flow Statement")
    st.write(f"Cash Flow from Operations (CFO): {data['Financials']['Cash Flow from Operations (CFO)']:,.2f}")
    st.write(f"Cash Flow from Investing (CFI): {data['Financials']['Cash Flow from Investing (CFI)']:,.2f}")
    st.write(f"Cash Flow from Financing (CFF): {data['Financials']['Cash Flow from Financing (CFF)']:,.2f}")
    st.markdown("---")

    st.subheader("Traffic Impact Analysis")
    st.write(f"Traffic Growth from GDP: {(data['Traffic Drivers']['gdp_growth_factor'] - 1) * 100:.2f}%")
    st.write(f"Traffic Impact from Quality: {data['Traffic Drivers']['Quality Impact on Traffic (%)']:.2f}%")
    st.write(f"Traffic Impact from Charges: {data['Traffic Drivers']['Aero Charges Impact on Traffic (%)']:.2f}%")
    st.write(f"Traffic Impact from Marketing: {data['Traffic Drivers']['Marketing Impact on Traffic (%)']:.2f}%")
