# ---------- Auth ----------
def check_password():
    config = None
    current_dir = pathlib.Path(__file__).parent
    candidates = [current_dir / "config.yaml", pathlib.Path.cwd() / "config.yaml"]
    for candidate in candidates:
        if candidate.exists():
            with candidate.open("r", encoding="utf-8") as f:
                config = yaml.load(f, Loader=SafeLoader)
                break
    if not config:
        st.error("Error: 'config.yaml' not found.")
        st.stop()
    if "credentials" not in config or "cookie" not in config:
        st.error("config.yaml must have top-level 'credentials' and 'cookie' sections.")
        st.stop()
    for k in ("name", "key", "expiry_days"):
        if k not in config["cookie"]:
            st.error(f"config.yaml missing cookie setting: '{k}'.")
            st.stop()
    try:
        config["cookie"]["expiry_days"] = int(config["cookie"]["expiry_days"])
    except Exception:
        st.error("Error: 'cookie.expiry_days' must be an integer (e.g., 30).")
        st.stop()

    authenticator = stauth.Authenticate(
        config["credentials"], config["cookie"]["name"], config["cookie"]["key"], config["cookie"]["expiry_days"]
    )
    st.session_state['authenticator'] = authenticator
    st.session_state['authenticator'] = authenticator
    try:
        authenticator.login(location='main')
        authentication_status = st.session_state.get("authentication_status")
    except TypeError:
        _, authentication_status, _ = authenticator.login('Login', 'main')

    if authentication_status:
        return True
    else:
        if authentication_status is False:
            st.error("Username/password is incorrect")
        else:
            st.warning("Please enter your username and password")
        st.stop()
    return authentication_status


# ---------- Utility state ----------
def _reset_decision_inputs_for_new_year():
    cy = st.session_state.get("current_year", 0)
    last = st.session_state.get("_last_decision_reset_year", None)
    if last != cy:
        for k in ['selected_project_display', 'loan_amount_display', 'selected_campaigns_display',
                  'opex_change_display', 'aero_charge_change_display', 'gdp_growth_display',
                  'lead_time_display', 'project_availability_year_display']:
            if k in st.session_state:
                del st.session_state[k]
        st.session_state._last_decision_reset_year = cy


def _snapshot_to_history_entry(year_value, airport_obj, scenario_label, gdp_growth_value=0.0, inputs_block=None):
    a = airport_obj
    if inputs_block is None:
        inputs_block = {
            'CAPEX Project': 'None',
            'Loan Amount': 0.0,
            'Marketing Campaigns': 'None',
            'OPEX Change (%)': 0.0,
            'Airport Charges Change (%)': 0.0,
        }
    entry = {
        'Year': year_value,
        'Strategic Decisions': {'Initial Strategy': a.strategy, 'Scenario': scenario_label},
        'Inputs': inputs_block,
        'Economic Factors': {'Actual GDP Growth': float(gdp_growth_value)},
        'Financials': {
            'Revenue (Aero)': a.revenue_aero,
            'Revenue (Non-Aero)': a.revenue_non_aero,
            'Revenue (Cargo)': a.revenue_cargo,
            'Revenue (Total)': a.revenue_aero + a.revenue_non_aero + a.revenue_cargo,
            'OPEX (Base)': a.opex,
            'OPEX (Total incl. Marketing)': a.total_opex if hasattr(a, "total_opex") else a.opex,
            'EBITDA': a.EBITDA,
            'EBITDAR': a.EBITDAR,
            'Profit': a.profit_after_comp,
            'Compensation': a.compensation,
            'Cash Balance (End of Year)': a.cash_balance,
            'Cash Flow from Operations (CFO)': a.cfo if hasattr(a, "cfo") else 0.0,
            'Cash Flow from Investing (CFI)': a.cfi if hasattr(a, "cfi") else 0.0,
            'Cash Flow from Financing (CFF)': a.cff if hasattr(a, "cff") else 0.0,
            'Interest Paid': a.interest_paid,
            'Equity': a.equity,
            'Debt': a.debt,
            'Gearing (Debt/Equity)': a.get_gearing(),
            'Asset Replacement Value': a.asset_replacement_value
        },
        'Operations': {
            'Traffic': a.traffic,
            'Cargo Tonnes': a.cargo_tonnes,
            'Capacity': a.capacity_pax,
            'Runway Capacity (movements/hr)': a.runway_capacity_movements,
            'Movements (peak hour)': a.current_movements,
            'Terminal Utilization': (a.traffic / a.capacity_pax) * 100 if a.capacity_pax > 0 else 0.0,
            'Runway Utilization': (a.current_movements / a.runway_capacity_movements) * 100 if a.runway_capacity_movements > 0 else 0.0,
            'Aeronautical Charge ($/pax)': a.aeronautical_charge,
            'Non-Aero Spend per Pax ($)': a.non_aero_spend_per_pax,
            'Non-Aero SQM': a.non_aero_sqm,
            'Depreciation': a.depreciation
        },
        'Traffic Drivers': {
            'Traffic Growth (%)': a.traffic_growth_rate * 100 if hasattr(a, "traffic_growth_rate") else 0.0,
            'Cargo Growth (%)': a.cargo_growth_rate * 100 if hasattr(a, "cargo_growth_rate") else 0.0,
            'Quality Impact on Traffic (%)': (a.quality_factor - 1) * 100 if hasattr(a, "quality_factor") else 0.0,
            'Aero Charges Impact on Traffic (%)': a.charge_impact * 100 if hasattr(a, "charge_impact") else 0.0,
            'Marketing Impact on Traffic (%)': a.marketing_impact * 100 if hasattr(a, "marketing_impact") else 0.0,
            'Cost Impact on Traffic (%)': a.cost_impact * -100 if hasattr(a, "cost_impact") else 0.0,
            'gdp_growth_factor': a.gdp_growth_factor if hasattr(a, "gdp_growth_factor") else 1.0
        }
    }
    return entry


def advance_year():
    st.session_state.current_year += 1
    st.session_state.gdp_growth = st.session_state.gdp_data.get(st.session_state.current_year, 2.0)
    st.session_state.airport.year = st.session_state.current_year
    st.session_state.airport.update_for_new_year(
        gdp_growth=st.session_state.gdp_growth,
        opex_change=st.session_state.get('opex_change_display', 0.0),
        aero_charge_change=st.session_state.get('aero_charge_change_display', 0.0)
    )
    # Append snapshot for new year
    a = st.session_state.airport
    y = st.session_state.current_year
    inputs_block = {
        'CAPEX Project': st.session_state.get('selected_project_display', 'None'),
        'Loan Amount': float(st.session_state.get('loan_amount_display', 0.0)),
        'Marketing Campaigns': ', '.join(st.session_state.get('selected_campaigns_display', ['None'])) if st.session_state.get('selected_campaigns_display') else 'None',
        'OPEX Change (%)': float(st.session_state.get('opex_change_display', 0.0)),
        'Airport Charges Change (%)': float(st.session_state.get('aero_charge_change_display', 0.0)),
    }
    snap = _snapshot_to_history_entry(y, a, st.session_state.scenario, st.session_state.gdp_growth, inputs_block)
    st.session_state.history = [h for h in st.session_state.history if h['Year'] != y] + [snap]

    # IMPORTANT: Do NOT pre-show decisions message for the new year
    # (User should press "Simulate Year" first)
    if '_decisions_msg_by_year' not in st.session_state:
        st.session_state._decisions_msg_by_year = {}
    st.session_state._decisions_msg_by_year[st.session_state.current_year] = False

    st.session_state.simulate_clicked = False
    scroll_to_top()
    st.rerun()


